rme<\/span><\/div>\u000a<div>&nbsp;<\/div>\u000a<div>Beşiktaş, Ziraat T&uuml;rkiye Kupası &Ccedil;eyrek Final İlk Ma&ccedil;ında 10 Şubat &Ccedil;arşamba G&uuml;n&uuml; Saat 21.15&rsquo;de Atat&uuml;rk Olimpiyat Stadı&rsquo;nda Torku Konyaspor&rsquo;u ağırlayacak.<\/div>\u000a<div>&nbsp;<\/div>\u000a<div><span style=\"font-size: large;\">Passolig Kart Sahipleri Bilet Alımı ve Kağıt Bilet Satışları<\/span><\/div>\u000a<div>8 Şubat Pazartesi Saat 14.00&rsquo;de satışa sunulacak biletlerden satın almak isteyen taraftarlarımız,&nbsp;<a href=\"http:\/\/www.passo.com.tr\/\"><span style=\"color: #0563c1;\"><span style=\"text-decoration: underline;\">www.passo.com.tr<\/span><\/span><\/a>&nbsp;, N&rsquo;Kolay satış noktaları ve BJK Plaza C Blok 5. Katta bulunan Kombine Satış Ofisi&rsquo;den biletlerini Passolig kartlarına y&uuml;kletebilirler.<\/div>\u000a<div>Hen&uuml;z Passolig kartı olmayan taraftarlarımız, kağıt biletlerini 8 Şubat Pazartesi itibariyle BJK Plaza C Blok 5. Katta bulunan Kombine Satış Ofisi&rsquo;den satın alarak Torku Konyaspor karşılaşmasını seyredebilecektir. Ma&ccedil; g&uuml;n&uuml; saat 11.00 itibariyle Atat&uuml;rk Olimpiyat Stadyumu bilet satış gişelerinden kağıt bilet satışları yapılacaktır.<\/div>\u000a<div>&nbsp;<\/div>\u000a<div><span style=\"font-size: large;\">Kale Arkası Kombine Sahipleri Doğu Trib&uuml;nde<\/span><\/div>\u000a<div>Vodafone Arena&rsquo;dan Kuzey ve G&uuml;ney Kale arkası kombine sahibi taraftarlarımız, karşılaşmayı Doğu trib&uuml;nden seyredeceklerdir.<\/div>\u000a<div>&nbsp;<\/div>\u000a<div>N&rsquo;Kolay Satış Noktaları i&ccedil;in&nbsp;<a href=\"https:\/\/www.nkolay.com.tr\/bayi-harita.aspx\" target=\"_blank\">TIKLAYIN<\/a><\/div>\u000a<div>Atat&uuml;rk Olimpiyat Stadyumu Ulaşımı İ&ccedil;in&nbsp;<a href=\"http:\/\/www.bjk.com.tr\/content\/vodafone_arena\/ataturk_olimpiyat_stadina_ulasim\" target=\"_blank\">TIKLAYIN<\/a><\/div>\u000a<div>&nbsp;<\/div>\u000a<div><span style=\"font-size: large;\">Passolig Kart Başvurusu<\/span><\/div>\u000a<div>Hen&uuml;z Beşiktaş Passolig kartı olmayan, Torku Konyaspor karşılaşmasına &ouml;ncelikli bilet satın almak isteyen taraftarlarımız, Beşiktaş Passolig kart başvurusunu&nbsp;<a href=\"http:\/\/www.passolig.com.tr\/\"><span style=\"color: #0563c1;\"><span style=\"text-decoration: underline;\">www.passolig.com.tr<\/span><\/span><\/a>&nbsp;internet adresinden yapabilir ya da Kombine Satış Ofisimizden anında Beşiktaş Passolig kartını alabilir ve ma&ccedil; biletini Passolig kartına y&uuml;kletebilirler.<\/div>\u000a<div>&nbsp;<\/div>\u000a<div>Beşiktaş Passolig Kart Başvurusu İ&ccedil;in <a href=\"http:\/\/www.passolig.com.tr\/?gclid=Cj0KEQiA8MSkBRCP5LaRlcOAusMBEiQAiqldkkjF_F8ZY-03ut0ZPgBC3p5v7bzNWzYwGNDbvHn-RX0aAuC68P8HAQ\" target=\"_blank\">TIKLAYIN<\/a>&nbsp;<\/div>\u000a<div>&nbsp;<\/div>\u000a<div><span style=\"font-size: large;\">Tek Ma&ccedil;lık Ge&ccedil;iş Kartı Teslimatları<\/span><\/div>\u000a<div>Passolig kartı olup, kartı hen&uuml;z eline ulaşmayan taraftarlarımız, Torku Konyaspor karşılaşmasına bilet y&uuml;klemeleri halinde tek seferlik ge&ccedil;ici kartlarını&nbsp;BJK Plaza C Blok 5. katta bulunan Kombine Satış Merkezi'nden&nbsp;teslim alabileceklerdir.<\/div>\u000a<div>&nbsp;<\/div>\u000a<div>&nbsp;<\/div>\u000a<div><span style=\"font-size: large;\">Engelli Trib&uuml;n Biletleri<\/span><\/div>\u000a<div>Y&uuml;zde 50 ve &uuml;zeri engelli taraftarlarımız, ma&ccedil; g&uuml;n&uuml; bilet satış gişesinden Beşiktaş Passolig kartlarına &uuml;cretsiz olarak bilet y&uuml;klemesi yaptırabileceklerdir. Engelli trib&uuml;n bileti, Atat&uuml;rk Olimpiyat Stadyumu engelli trib&uuml;n kapasitesiyle sınırlıdır. Engelli biletlerinden faydalanacak taraftarlarımızın da Passolig kartlarının olması gerekmektedir.<\/div>","End":"\/Date(1455135300000+0200)\/","EventType":"TFF","FacebookEventId":"","HomeClub":{"Code":"BES","Id":"154cd28a-7a83-e311-bec2-00155d033604","League":{"Clubs":null,"Code":"100","Id":"8c53abb6-8783-e311-bec2-00155d033604","Name"